SELECT SUM("probehnuto"."client_id") as agg_0, SUM("probehnuto"."kc_proklikano") as agg_1 FROM "probehnuto" LEFT OUTER JOIN "client" ON "probehnuto"."client_id" = "client"."client_id" LEFT OUTER JOIN "dobito" ON "client"."client_id" = "dobito"."client_id" LEFT OUTER JOIN "probehnuto_mimo_penezenku" ON "client"."client_id" = "probehnuto_mimo_penezenku"."client_id"  WHERE "dobito"."client_id" BETWEEN 3671279.7717490513 AND 9707867.705038378 AND "probehnuto_mimo_penezenku"."client_id" BETWEEN 78244 AND 97100 AND "dobito"."month_year_datum_transakce" LIKE '%2014-08-0%1%' AND "probehnuto"."month_year_datum_transakce" = '2013-03-01' AND "dobito"."sluzba" IN ('d', 'b', 'e', 'f') AND "client"."kraj" LIKE '%Královéhradecký%'